```python
# Function to check if a number is prime
def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True

# Function to find the sum of all prime numbers between two given integers (inclusive)
def funcImp(start, end):
    prime_sum = 0
    for num in range(start, end + 1):
        if is_prime(num):
            prime_sum += num
    return prime_sum

# Test cases
test_cases = [
    (1, 10),  # 2 + 3 + 5 + 7 = 17
    (10, 20),  # 11 + 13 + 17 + 19 = 60
    (20, 30),  # 23 + 29 = 52
    (30, 40),  # 31 + 37 = 68
    (40, 50),  # 41 + 43 + 47 = 131
    (50, 60),  # 53 + 59 = 112
]

# Execute test cases
for start, end in test_cases:
    result = funcImp(start, end)
    print(f"Sum of prime numbers between {start} and {end} (inclusive): {result}")
```

